import React, { useState } from "react";
import {
  TextField,
  Grid,
  Box, 
  Autocomplete,
  Button, 
} from "@mui/material";
import "../../styles/LandingPage.scss";
import { useNavigate } from "react-router-dom"; // Import useNavigate

function AuctionCar() {

  const [accessibility, setAccessibility] = useState("");
  const navigate = useNavigate(); // Initialize navigate


  const accessibilities = [
    "80331 Munchen",
    "85748 Garching Bei Munchen",
    "86836 Klosterlechfeld",
    "85716 Unterschleissheim",
  ];


  const handleAccessibilityChange = (event, newValue) => {
    setAccessibility(newValue);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
      alert("Car and auction created successfully!");
      navigate("/myauctions"); // Redirect to myauctionspage

  };

  return (
    <div>
      <div className="pageHeading">Auction A Car</div>
      <Box
        component="form"
        className="auctionACarContainer"
        sx={{ padding: "20px 40px", maxWidth: "100%" }}
        onSubmit={handleSubmit}
        noValidate
      >
        <div className="sectionHeading"> About Event </div>
        <Grid item xs={12} sm={6} md={4} lg={3}>
            <div className="aboutCarField">
              <Autocomplete
                options={accessibilities}
                value={accessibility}
                onChange={handleAccessibilityChange}
                renderInput={(params) => (
                  <TextField {...params} label="Postal Code" />
                )}
              />
            </div>
          </Grid>



        <div className="aboutEventContainer">
          <Button
            type="submit"
            variant="contained"
            color="primary"
            className="secondaryButton"
          >
            Submit
          </Button>
        </div>
      </Box>
    </div>
  );
}

export default AuctionCar;
